import {tag, tagTime, tagWrapper} from '../style/tagCss'

export default function Tags(props) {
    return (
        <tag className="tags">
            <tagWrapper className="tags-wrapper">
                <p>{props.name}</p>
                <tagTime>{props.tag}</tagTime>
            </tagWrapper>
            <div>开始</div>

        </tag>
    )
}
